#include <string>
#include <vector>
#include <iostream>
#include <list>
#include <map>

using namespace std;

struct my_struct;
using my_map = map<char, my_struct>;
struct my_struct
{
    list<int> current_list;
    my_map next;
};

class Solution {
public:
    vector<int> stringIndices(vector<string>& wordsContainer, vector<string>& wordsQuery) {
        my_struct old_results;
        for (int i = 0; i < wordsContainer.size(); ++i)
        {
            old_results.current_list.push_back(i);
        }

        vector<int> results;
        results.reserve(wordsQuery.size());

        for (auto& word : wordsQuery)
        {
            list<int> result_list;

            my_struct* current_results_ptr = &old_results;
            for (size_t i = 1; i <= word.size(); ++i)
            {
                auto& current_results = *current_results_ptr;
                const auto& current_list = current_results.current_list;
                char word_char = word[word.size() - i];

                list<int> next_list;
                if (current_results.next.empty())
                {
                    for(int j : current_list)
                    {
                        const string& compare = wordsContainer[j];
                        if (compare.size() < i)
                        {
                            continue;
                        }
                        char compare_char = compare[compare.size() - i];
                        current_results.next[compare_char].current_list.push_back(j);
                    }
                }
                next_list = current_results.next[word_char].current_list;

                if (next_list.empty())
                {
                    result_list = current_list;
                    break;
                }
                else
                {
                    result_list = next_list;
                }

                current_results_ptr = &(current_results.next[word_char]);
            }

            int result = 0;
            size_t min_size = 10000000;
            for (int j : result_list)
            {
                if (wordsContainer[j].size() < min_size)
                {
                    min_size = wordsContainer[j].size();
                    result = j;
                }
            }
            results.push_back(result);
        }
        return results;
    }
};

